jQuery.noConflict();jQuery(document).ready(function(){jQuery(window).load(function(){jQuery("#loader, .loader").hide();jQuery.post("/app/system/showprofiler/",function(a){jQuery("body").append(a)})});jQuery(".datepicker").datepicker({changeMonth:true,changeYear:true,dateFormat:"yy-mm-dd",firstDay:1});jQuery(".datepicker-registration").datepicker({changeMonth:true,changeYear:true,yearRange:"1960:2000",dateFormat:"yy-mm-dd",firstDay:1});jQuery("button.ajax-button").click(function(){var a=jQuery(this).attr("href");var b=jQuery(this).val();jQuery("#dialog").load(a).dialog({title:b,width:"550px",modal:true,position:{my:"center",at:"top",of:window},buttons:{Cancel:function(){jQuery(this).dialog("close")}}})});jQuery("a.showReplyForm").click(function(a){a.preventDefault();jQuery(this).parents(".messageWrapper").find(".replyForm").toggle(500);jQuery(".replyForm:visible textarea.mediuminput").focus()});jQuery("a#delImg").click(function(){event.preventDefault();var a=jQuery(this).attr("href");var b=jQuery("#csrf").val();jQuery.post(a,{csrf:b},function(c){if(c=="success"){jQuery("#currentLogo").hide(500);jQuery("#uploadLogo").removeClass("nodisplay")}else{jQuery("#currentLogo").append("<label class='error'>"+c+"</label>")}});return false})});